.product--detail-upper .product--buybox .product--order-timer {
    border-top: none;
    border-bottom: none;
    background: #fafafc;
    border-radius: 6px;
    background-image: linear-gradient(to bottom, #557fc9 0%, #3d64ab 100%);
    color: #fff;
    -webkit-box-shadow: 0 2px 2px 0 rgba(0,0,0,0.14), 0 1px 5px 0 rgba(0,0,0,0.12), 0 3px 1px -2px rgba(0,0,0,0.2);
    box-shadow: 0 2px 2px 0 rgba(0,0,0,0.14), 0 1px 5px 0 rgba(0,0,0,0.12), 0 3px 1px -2px rgba(0,0,0,0.2);
}
product--buybox .product--order-timer .order--date {
    font-weight: bold;
    color: #26e978;
}
